import Head from 'next/head';

const Layout = (props) => (
    <div>
        <Head>
            <title>listing -page</title>
            <link href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css" rel="stylesheet" />
        </Head>
        <h1>Navigation</h1>
          {props.children}
        <h1>footer</h1>
    </div>
)
export default Layout;
